import React,{useState,useEffect} from 'react'
import { Button } from 'react-bootstrap';
import './tracker-style.css';
import Axios from "axios";
function Tracker() {


    useEffect(()=>{
        Axios.get('https://tutorial4-api.herokuapp.com/api/users/').then((response)=>{
             console.log(response);
          });
     },[]);


    return (
       <div>
           <form>
                <div className="header">Covid 19 Tracker INDIA</div>
                <div className="searchbar-outerdiv">
                    <p>Search your district or state</p>
                    <div class="form-group has-search">
                        <span class="fa fa-search form-control-feedback"></span>
                        <input type="text" className="form-control search" placeholder="Search"/>
                    </div>
                </div>
                <div className="display-all">
                    <div className="confirmed">
                        <p>Confirmed</p>
                        <p> + 3598 </p>
                        <h4> 3,05,88,511 </h4>
                    </div>
                    <div className="active">
                        <p>Active</p>
                        <p> +21 </p>
                        <h4> 4,79,498 </h4>
                    </div>
                    <div className="recovered">
                        <p>Recovered</p>
                        <p> +1,076</p>
                        <h4> 2,96,94,080 </h4>
                    </div>
                    <div className="deceased">
                        <p>Deceased</p>
                        <p> +66</p>
                        <h4> 4,02,824</h4>
                    </div>
                </div>
            </form>
       </div>
    )
}

export default Tracker;
